/**
 * Compile an objective function for efficient gradient computation. Useful for L-BFGS and other gradient-based optimizers.
 *
 * @param params - Array of parameter Values
 *
 * @param objectiveFn - Function that computes scalar objective from parameters
 *
 * @returns CompiledFunctions that can be passed to lbfgs()
 *
 * @example
 * ```typescript
 * const x = V.W(1.0);
 * const y = V.W(2.0);
 * const params = [x, y];
 *
 * // Compile Rosenbrock function
 * const compiled = V.compileObjective(params, (p) => {
 *   const [x, y] = p;
 *   const a = V.sub(V.C(1), x);
 *   const b = V.sub(y, V.pow(x, 2));
 *   return V.add(V.pow(a, 2), V.mul(V.C(100), V.pow(b, 2)));
 * });
 *
 * // Use with L-BFGS
 * lbfgs(params, compiled, { verbose: true });
 * ```
 *
 */

